import React,{useState} from "react";
import { useNavigate } from "react-router";

const UserHome = () => {
    const navigate = useNavigate();
    return (
        <>
        <div>
        <button onClick={(e) => navigate("/") } className="back-button">Back</button>
        <h1>Account & Profile S </h1>
        </div>
        </>
    )
}

export default UserHome;
